INSERT INTO `Messages` VALUES (1,'One morning, when Gregor Samsa woke from troubled dreams, he found himself transformed in his bed into a horrible vermin.',34,31,0,0,0,'2016-12-27 14:30:40'),(2,'He lay on his armour-like back, and if he lifted his head a little he could see his brown belly, slightly domed and divided by arches into stiff sections.',39,31,0,0,0,'2017-01-31 14:50:41'),(3,'The bedding was hardly able to cover it and seemed ready to slide off any moment.',34,29,0,0,0,'2016-12-16 20:47:25'),(4,'His many legs, pitifully thin compared with the size of the rest of him, waved about helplessly as he looked.',5,1,0,0,0,'2017-01-06 20:08:26'),(5,'What\'s happened to me?  he thought. It wasn\'t a dream.',39,36,0,0,0,'2016-12-31 00:34:04'),(6,'His room, a proper human room although a little too small, lay peacefully between its four familiar walls.',1,17,0,0,0,'2017-01-01 09:53:11'),(7,'It showed a lady fitted out with a fur hat and fur boa who sat upright, raising a heavy fur muff that covered the whole of her lower arm towards the viewer.',22,20,0,0,0,'2016-12-19 14:40:49'),(8,'Gregor then turned to look out the window at the dull weather.',38,31,0,0,0,'2016-12-15 06:53:52'),(9,'Drops of rain could be heard hitting the pane, which made him feel quite sad.',39,33,0,0,0,'2016-12-22 09:00:39'),(10,'However hard he threw himself onto his right, he always rolled back to where he was.',28,26,0,0,0,'2016-12-22 03:03:18'),(11,'Oh, God, he thought, what a strenuous career it is that I\'ve chosen!',34,30,0,0,0,'2017-01-16 11:35:42'),(12,'Travelling day in and day out.',37,17,0,0,0,'2017-01-08 05:10:09'),(13,'It can all go to Hell!',37,35,0,0,0,'2017-01-21 16:22:13'),(14,'He slid back into his former position.',35,8,0,0,0,'2017-01-30 07:36:19'),(15,'Getting up early all the time, he thought, it makes you stupid.',28,6,0,0,0,'2017-02-01 00:04:12'),(16,'You\'ve got to get enough sleep.',8,3,0,0,0,'2017-01-05 16:32:25'),(17,'Other travelling salesmen live a life of luxury.',4,2,0,0,0,'2016-12-14 16:20:42'),(18,'I ought to just try that with my boss; I\'d get kicked out on the spot.',39,19,0,0,0,'2017-01-26 23:49:29'),(19,'But who knows, maybe that would be the best thing for me.',27,14,0,0,0,'2016-12-09 04:53:28'),(20,'He\'d fall right off his desk!',27,24,0,0,0,'2016-12-26 21:07:45'),(21,'That\'s when I\'ll make the big change.',21,15,0,0,0,'2016-12-25 12:28:30'),(22,'First of all though, I\'ve got to get up, my train leaves at five.',2,1,0,0,0,'2017-01-16 02:59:28'),(23,' And he looked over at the alarm clock, ticking on the chest of drawers.',38,3,0,0,0,'2017-01-16 19:44:16'),(24,'God in Heaven!  he thought.',39,31,0,0,0,'2017-01-23 11:16:47'),(25,'It was half past six and the hands were quietly moving forwards, it was even later than half past, more like quarter to seven.',35,18,0,0,0,'2017-01-22 00:14:13'),(26,'Had the alarm clock not rung?',32,1,0,0,0,'2017-02-05 07:03:12'),(27,'He could see from the bed that it had been set for four o\'clock as it should have been; it certainly must have rung.',35,29,0,0,0,'2016-12-09 09:07:06'),(28,'Yes, but was it possible to quietly sleep through that furniture-rattling noise?',22,15,0,0,0,'2016-12-11 07:26:40'),(29,'True, he had not slept peacefully, but probably all the more deeply because of that.',1,7,0,0,0,'2017-02-02 01:54:17'),(30,'What should he do now?',33,1,0,0,0,'2017-01-31 21:58:30'),(31,'The office assistant was the boss\'s man, spineless, and with no understanding.',39,38,0,0,0,'2017-01-01 00:01:34'),(32,'What about if he reported sick?',20,14,0,0,0,'2017-01-06 09:51:21'),(33,'But that would be extremely strained and suspicious as in fifteen years of service Gregor had never once yet been ill.',28,2,0,0,0,'2017-01-28 12:23:45'),(34,'His boss would certainly come round with the doct',31,4,0,0,0,'2016-12-15 09:17:32'),(35,'O my friend  but it is too much for my strength  I sink under the weight of the splendour of these visions!',24,1,0,0,0,'2017-01-21 17:25:27'),(36,'A wonderful serenity has taken possession of my entire soul, like these sweet mornings of spring which I enjoy with my whole heart.',23,12,0,0,0,'2016-12-21 10:31:35'),(37,'I am alone, and feel the charm of existence in this spot, which was created for the bliss of souls like mine.',31,12,0,0,0,'2016-12-27 18:18:32'),(38,'I am so happy, my dear friend, so absorbed in the exquisite sense of mere tranquil existence, that I neglect my talents.',38,28,0,0,0,'2016-12-27 07:11:44'),(39,'I should be incapable of drawing a single stroke at the present moment; and yet I feel that I never was a greater artist than now.',25,2,0,0,0,'2016-12-12 23:47:59'),(40,'Li nov lingua franca va esser plu simplic e regulari quam li existent Europan lingues. It va esser tam simplic quam Occidental in fact, it va esser Occidental.',37,22,0,0,0,'2017-02-01 11:30:34'),(41,'Por scientie, musica, sport etc, litot Europa usa li sam vocabular. Li lingues differe solmen in li grammatica, li pronunciation e li plu commun vocabules.',39,13,0,0,0,'2016-12-29 10:17:56'),(42,'Li Europan lingues es membres del sam familie. Lor separat existentie es un myth. Por scientie, musica, sport etc, litot Europa usa li sam vocabular.',35,25,0,0,0,'2016-12-19 22:42:10'),(43,'Morbi in sem quis dui placerat ornare. Pellentesque odio nisi, euismod in, pharetra a, ultricies in, diam. Sed arcu. Cras consequat.',22,19,0,0,0,'2016-12-10 18:58:35'),(44,'Pellentesque fermentum dolor. Aliquam quam lectus, facilisis auctor, ultrices ut, elementum vulputate, nunc.',36,32,0,0,0,'2016-12-15 08:01:44'),(45,'Sed adipiscing ornare risus. Morbi est est, blandit sit amet, sagittis vel, euismod vel, velit. Pellentesque egestas sem. Suspendisse commodo ullamcorper magna.',35,24,0,0,0,'2017-01-27 23:14:18'),(46,'Nulla sed leo. Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos.',38,37,0,0,0,'2017-01-05 17:56:57'),(47,'Fusce lacinia arcu et nulla. Nulla vitae mauris non felis mollis faucibus.',22,8,0,0,0,'201